\label{AL_section} Let $B$ be an indefinite quaternion algebra of discriminant $D$ over $\Q$ and let $\mathcal{O}_N$ be an Eichler order of level $N$ coprime to $D$ in $B$. Consider the subgroup of the normalizer of $\mathcal{O}_N$ in $B$ \[N_{{B}^	imes_{> 0}}(\mathcal{O}_N) := \{u \in {B}^	imes : 	ext{nrd}(u) > 0 	ext{ and } u^{-1} \mathcal{O}_N u = \mathcal{O}_N \} \] consisting of elements of positive reduced norm. The group of 	extbf{Atkin--Lehner involutions} of $X_0^D(N)$ is defined as \[ W_0(D,N) := N_{{B}^	imes_{> 0}}(\mathcal{O}_N) / \mathbb{Q}^	imes \mathcal{O}_N^	imes \leq 	ext{Aut}(X_0^D(N)). \] Letting $\omega(n)$ denote the number of distinct prime divisors of an integer $n$, $W_0(D,N)$ is a finite abelian $2$-group of the form \[ W_0(D,N) = \{w_m : m \parallel DN\} \cong \left(\Z/2\Zight)^{\omega(DN)}. \] Let us be a bit more concrete about the quaternion arithmetic here in a way that will be useful later, following \cite{Ogg83} which in turn follows Eichler. Because $B$ is indefinite, $\mathcal{O}_N$ has trivial class number and hence each left $\mathcal{O}_N$-ideal $\mathfrak{a}$ is principal; there exists $\alpha \in B^	imes$ such that $\mathfrak{a} = \mathcal{O}_N \cdot \alpha$. The group $W_0(D,N)$ is realized as the group of two-sided ideals of $\mathcal{O}_N$ modulo the ideals of the form $x \mathcal{O}_N$ with $x \in \Q^	imes$. For a Hall divisor $m \parallel DN$, we obtain the corresponding involution of $X_0^D(N)$ as follows: there exists a two-sided ideal $\mathfrak{b} =  eta \mathcal{O}_N$ with $\mathfrak{b}^2 = m \cdot \mathcal{O}_N$. Letting $\mathfrak{b}_p := \mathfrak{b} \otimes_\Z \Z_p$ denote the completion of $\mathfrak{b}$ at $p$, we have that $ eta$ is determined locally as follows:  egin{itemize} \item $\mathfrak{b}_p = \mathcal{O}_{N,p}$ if $p 
mid m$, \item $\mathfrak{b}_p$ is the unique maximal ideal of $\mathcal{O}_{N,p}$ if $p \mid \gcd(m,D)$, and \item $\mathfrak{b}_p$ is associate to the ideal \[  egin{pmatrix} 0 & 1 \ p^{	ext{ord}_p(N)} & 0 \end{pmatrix} \cdot \psi_p\left(\mathcal{O}_{N,p}ight) \] if $p \mid N$. \end{itemize} The element $ eta \in B^	imes$ normalizes $\mathcal{O}_N$, yielding the involution $w_m$ of $X_0^D(N)$ over $\Q$. For a subgroup $W \leq W_0(D,N)$, we call the quotient $X_0^D(N)/W$ an 	extbf{Atkin--Lehner quotient} of $X_0^D(N)$. We also call the elements of $\Aut\left(X_0^D(N)/Wight)$ induced by the elements of $W_0(D,N)$ Atkin--Lehner involutions. The fixed points of Atkin--Lehner involutions are determined by Ogg as being complex multiplication (CM) points by certain imaginary quadratic orders.  egin{proposition}\cite[p. 283]{Ogg83}\label{prop: Ogg_fixed_pts} Let $m>1$ with $m \parallel DN$. The fixed points of the Atkin--Lehner involution $w_m$ acting on $X_0^D(N)$ are points with 	extnormal{CM} by the following imaginary quadratic orders: \[ R =  egin{cases} \Z[i] 	ext{ and } \Z[\sqrt{-2}] &\quad	extnormal{if } m = 2, \ \Z\left[ rac{1+\sqrt{-m}}{2}ight]	ext{and } \Z[\sqrt{-m}] &\quad	extnormal{if } m \equiv 3 \;( mod \; 4), \ \Z[\sqrt{-m}] &\quad	extnormal{ otherwise}.\ \end{cases} \] \end{proposition} For each of the orders $R$ listed for $m$ in this proposition, the count of $R$-CM points fixed by $w_m$ is given explicitly by Ogg as a product \[ h(R) \prod_{\substack{p \mid  rac{DN}{m} \ 	ext{prime}}} 
u_p(R,\mathcal{O}_N), \] where $h(R)$ is the class number of the order $R$ and $
u_p(R,\mathcal{O}_N)$ is the number of inequivalent optimal embeddings of the localization $R_p$ of $R$ at $p$ into the localization $(\mathcal{O}_N)_p$ of $\mathcal{O}_N$ at $p$. The latter optimal embedding counts are given by \cite[Theorem 2]{Ogg83}. One can compute the genus of any Atkin--Lehner quotient using \cref{prop: Ogg_fixed_pts} and \cref{prop: genus_formula} with the Riemann--Hurwitz theorem, and such computations are implemented in the file 	exttt{quot{\_}genus.m} in \cite{PSRepo}. The following result of Ribet is an important tool in our study. Ribet's original result in \cite{Ribet90} contains a hypothesis that $N$ is squarefree, but this hypothesis can be removed by work of Hijikata--Pizer--Shemanske \cite{HPS89a, HPS89b} and so does not appear here.  egin{theorem}\cite{Ribet90, BD96, HPS89a, HPS89b}\label{Ribet_isog} There is an isogeny defined over $\Q$ \[ \Psi \colon \Jac(X_0(DN))^{D-
ew} \longrightarrow \Jac(X_0^D(N)) \] such that, for each Atkin--Lehner involution $w_m(D,N) \in W_0(D,N)$, the corresponding automorphism $\Psi^*(w_m(D,N))$ on $\Jac(X_0(DN))^{D-	extnormal{new}}$ is  egin{equation}\label{eqn: AL_action_Ribet} \Psi^*(w_m(D,N)) = (-1)^{\omega(\gcd(D,m))}w_m(1,DN), \end{equation} where $w_m(1,DN) \in W_0(1,DN)$ denotes the Atkin--Lehner involution corresponding to $m$ on the modular curve $X_0(DN)$. \end{theorem}

