\label{theorem: eqns_intro_version}
(Each) of the curves $X = X_0^D(N)/W$ listed in \cref{table: non_elliptic_eqns} is non-elliptic of genus $1$. For the $4$ triples $(D,N,W)$ in the set \begin{align*} \Big\{ &\left(14, 11, \langle w_2, w_{11} \rangle \right), \left(46, 3, \langle w_2, w_3 \rangle \right), &\left(570, 1, \langle w_5, w_{57} \rangle \right), \left(570, 1, \langle w_6, w_{190} \rangle\right) \Big\}, \end{align*} the curve $X$ admits exactly one of the two models given in \cref{table: non_elliptic_eqns} over $\Q$. Each of the remaining $146$ curves $X$ in \cref{table: non_elliptic_eqns} admits the given model over $\Q$.
(For) the $405$ curves $X = X_0^D(N)/W$ listed in \cref{table: genus_2_bielliptic_eqns}, we have that $X$ is bielliptic of genus $2$ and admits the given model over $\Q$.

