ewcommand{ reddy}[1]{{\color{magenta} 	extsf{$\spadesuit\spadesuit\spadesuit$ Freddy: [#1]}}} 	itle{Shimura curve Atkin--Lehner quotients of genus at most two}  egin{document} \subjclass[2020]{Primary 11G18, Secondary 11G10, 11G05, 11G07} \author{\sc Oana Padurariu} \address{Oana Padurariu \ Max-Planck-Institut fr Mathematik Bonn\ Germany} \urladdr{https://sites.google.com/view/oanapadurariu/home} \email{oana.padurariu11@gmail.com} \author{\sc Frederick Saia} \address{Frederick Saia \ University of Illinois Chicago\ USA} \urladdr{https://fsaia.github.io/site/} \email{fsaia@uic.edu}  egin{abstract} We provide a complete enumeration of all quotients of genus $0, 1$ and $2$ of the Shimura curves $X_0^D(N)$ over $\Q$ by non-trivial subgroups of Atkin--Lehner involutions. For all $1270$ genus $1$ quotients $X$ with $N$ squarefree, we determine the isomorphism class of the Jacobian $X$. For $146$ non-elliptic genus $1$ curves $X$ and for $405$ curves genus $2$ quotients $X$, we provide a defining equation for $X$. A main tool for us is the theory of Cerednik--Drinfeld uniformizations of the curves $X_0^D(N)$, which we implement in wider generality than has previously been done in the literature. \end{abstract} \maketitle \section{Introduction} Since Mazur's work on isogenies of elliptic curves over $\Q$ \cite{MazurIsogenies}, there has been sustained interest in classifying those modular curves $X_0(N)$ over $\Q$ which possess infinitely many points of specified degree $d$. The cases of $d=2$ and $d=3$ were respectively handled by Bars \cite{Bars99} (combined with work of Ogg \cite{Ogg74}) and by Jeon \cite{Jeon}. The $d=4$ case was recently handled independently by Hwang--Jeon \cite{HJ24} and by Derickx--Orli'{c} \cite{DO24}. Whereas the curves $X_0(N)$ parameterize elliptic curves with additional isogeny structure, the Shimura curves $X_0^D(N)$ over $\Q$, with $\gcd(D,N) = 1$ and with $D>1$ the discriminant of an indefinite quaternion algebra over $\Q$, parameterize abelian surfaces with quaternionic multiplication and additional structure. These Shimura curves have no odd-degree points (see \cref{thm: no_real_points}), so the first degree to consider is $d=2$. In this case, an analogue of Bars' result on infinitude of quadratic points was proven for the curves $X_0^D(N)$ with $D>1$ by the current authors in \cite{PS25}, generalizing a result of Rotger in the $N=1$ case \cite{Rotger02}. Given the motivation of classifying torsion structures of abelian surfaces, the same classification problem for quotients of the Shimura curves $X_0^D(N)$ by subgroups of the full Atkin--Lehner group $W_0(D,N) \leq \Aut(X_0^D(N))$ is equally worthy of attention; these quotients parameterize abelian surfaces with \emph{potential} quaternionic multiplication and additional structure. Additionally, these quotients are themselves significant in studying infinitude of points of fixed degree for the curves $X_0^D(N)$, as they provide subcovers which can act as sources of such points. For example, from \cite{PS25} we know that each Shimura curve $X_0^D(N)$ with infinitely many quadratic points has an Atkin--Lehner quotient $X_0^D(N)/\langle w_m angle$ of genus $0$ or $1$ with infinitely many rational points. In this work, we initiate a study of low-degree points on Atkin--Lehner quotients of the Shimura curves $X_0^D(N)$ by focusing on low-genus quotients. Our first main result is a determination of all Atkin--Lehner quotients of genus at most $2$.  egin{theorem}\label{theorem: genus_le_2} There are exactly $3711$ Shimura curves quotients $X_0^D(N)/W$, with $D>1$ and with $W \leq W_0(D,N)$ a non-trivial subgroup, of genus at most $2$. In particular, there are  egin{itemize} \item $779$ curves $X_0^D(N)/W$ having genus $0$, \item $1352$ curves $X_0^D(N)/W$ having genus $1$, and \item $1580$ curves $X_0^D(N)/W$ having genus $2$. \end{itemize} \end{theorem} Each quotient of genus $0$ is either a pointless conic over $\Q$, or has a rational point and is therefore isomorphic to $\mathbb{P}^1_\Q$. Each genus $1$ quotient either has a rational point, and is thus an elliptic curve isomorphic to its Jacobian, or is a non-elliptic curve of genus $1$. We determine Jacobians in the genus $1$ case when $N$ is squarefree, and we determine them up to isogeny when $N$ is not squarefree.  egin{theorem}\label{theorem: iso_classes_thm_intro} Let $X = X_0^D(N)/W$ be a genus $1$ curve with $W \leq W_0(D,N)$ a non-trivial Atkin--Lehner subgroup.  egin{enumerate} \item If $X$ is among the $1270$ such curves with $N$ squarefree, then the isomorphism class of $\Jac(X)$ is as given in \cref{table: genus_1_sqfree_iso_classes}. \item If $X$ is among the $82$ such curves with $N$ not squarefree, then the isogeny class of $\Jac(X)$ is as given in \cref{table: genus_1_not_sqfree_isog_classes}. \end{enumerate} \end{theorem} From \cref{theorem: genus_le_2} and \cref{theorem: iso_classes_thm_intro}, combined with investigations regarding the existence of rational points on Atkin--Lehner quotients of genera $0$ and $1$, we reach the following result regarding infinitude of rational points.  egin{corollary}\label{corollary: infinitude_of_rational_points}  egin{enumerate} \item For each of the $650$ triples $(D,N,W)$ listed in \cref{table: genus_0_rat_pts}, the curve $X_0^D(N)/W$ is isomorphic to $\mathbb{P}^1_\Q$. \item For each of the $537$ triples $(D,N,W)$ listed in \cref{table: genus_1_rat_pts_pos_rank}, the curve $X_0^D(N)/W$ is an elliptic curve with positive rank. \item If $X_0^D(N)/W$ has infinitely many rational points and $(D,N,W)$ is not in \cref{table: genus_0_rat_pts} or \cref{table: genus_1_rat_pts_pos_rank}, then $(D,N,W)$ must be among the $48$ triples listed in \cref{table: genus_0_unknown_rat_pts} or among the $54$ triples listed in \cref{table: genus_1_unknown_rat_pts_pos_rank}. \end{enumerate} \end{corollary}  egin{proof} Part (1) follows from our determination that the listed curves have rational points, which comes in \cref{rational_points_subsection}. Part (2) follows from rational points investigations for genus $1$ quotients which appear in \cref{rational_points_subsection} and \cref{non_elliptic_rat_pts_section}, along with rank computations in Magma for the isogeny classes of the Jacobians of these curves (as given by \cref{theorem: iso_classes_thm_intro}). It follows from Faltings' Theorem that if $X_0^D(N)/W$ has infinitely many rational points, then it must be isomorphic to $\P^1_\Q$ or be an elliptic curve over $\Q$ of positive rank. If this is the case and $(D,N,W)$ does not already appear in one of the tables referenced in parts (1) and (2), then $X_0^D(N)$ must either be  egin{itemize} \item a genus $0$ curve for which we remain unsure of the existence of a rational point, in which case $(D,N,W)$ appears in \cref{table: genus_0_unknown_rat_pts}, or \item a genus $1$ curve with positive rank Jacobian for which we remain unsure of the existence of a rational point, in which case $(D,N,W)$ appears in \cref{table: genus_1_unknown_rat_pts_pos_rank}. \qedhere \end{itemize} \end{proof} We also produce models for hundreds of Atkin--Lehner quotients of Shimura curves. To our knowledge, of the models referenced in the following theorem fewer than $70$ have appeared in prior work (including \cite{Kurihara, GR04, GR06, GY17, PS23}).  egin{theorem}\label{theorem: eqns_intro_version}  egin{enumerate} \item Each of the curves $X = X_0^D(N)/W$ listed in \cref{table: non_elliptic_eqns} is non-elliptic of genus $1$. For the $4$ triples $(D,N,W)$ in the set  egin{align*} \Big\{ &\left(14, 11, \langle w_2, w_{11} angle ight), \left(46, 3, \langle w_2, w_3 angle ight), \ &\left(570, 1, \langle w_5, w_{57} angle ight), \left(570, 1, \langle w_6, w_{190} angleight) \Big\}, \end{align*} the curve $X$ admits exactly one of the two models given in \cref{table: non_elliptic_eqns} over $\Q$. Each of the remaining $146$ curves $X$ in \cref{table: non_elliptic_eqns} admits the given model over $\Q$. \item For the $405$ curves $X = X_0^D(N)/W$ listed in \cref{table: genus_2_bielliptic_eqns}, we have that $X$ is bielliptic of genus $2$ and admits the given model over $\Q$. \end{enumerate} \end{theorem} A main tool in all parts of this study, following the initial enumeration of quotients of genus at most $2$, is the theory of {\v{C}}erednik--Drinfeld $p$-adic uniformizations of the Shimura curves $X_0^D(N)$ for primes $p \mid D$. We implement an algorithm to determine the structure of the dual graph of the model over $\Z_p$, for $p \mid D$, of an Atkin--Lehner quotient $X_0^D(N)/W$ with $N$ squarefree, from which we are able to compute reduction types of such quotients at primes dividing $D$ (see \cref{algorithm: Kodaira_alg}) and to check for the existence of local points at primes dividing $D$ (see \cref{algorithm: local_points}). The former referenced algorithm is used in our proof of \cref{theorem: iso_classes_thm_intro}, the latter is used in determining the existence of rational points for \cref{corollary: infinitude_of_rational_points}, and both are integral in our results on equations of Atkin--Lehner quotients. Explicit computations using the theory of {\v{C}}erednik--Drinfeld in this context in past works (e.g., \cite{Kurihara, Ogg85, GR06}) seem to have been limited either to level $N=1$ or to quotients by single Atkin--Lehner involutions. It is our hope that our implementation, along with the extensive computations and examples provided in this work, are helpful to readers wishing to learn or use this theory. The remainder of this work is organized as follows.  egin{itemize} \item In \cref{Background_section}, we provide background material on Shimura curves, their Atkin--Lehner quotients, and the theory of {\v{C}}erednik--Drinfeld uniformizations of these curves. \item We state in \cref{Kodaira_section} the algorithms referenced above. \item \cref{genus_le_2_section} features the proof of \cref{theorem: genus_le_2}, as well as a first pass concerning rational points on quotients of genus $0$ and $1$ in \cref{rational_points_subsection}. \item We determine isogeny classes of Jacobians genus $1$ in \cref{genus_1_isogeny_class_section}, and subsequently determine isomorphism classes of these Jacobians when $N$ is squarefree in \cref{genus_1_iso_classes_section}. The main results of these two sections combine to give \cref{theorem: iso_classes_thm_intro}. \item Models for non-elliptic genus $1$ curves are determined in \cref{non_elliptic_eqns_section}. We also briefly return to the question of rational points here (\cref{non_elliptic_rat_pts_section}) in order to prove several genus $1$ quotients have rational points in a non-constructive manner. We produce equations for bielliptic genus $2$ Atkin--Lehner quotients in \cref{genus_2_bielliptics_section}. \cref{theorem: eqns_intro_version} follows from the main results of these two sections, \cref{theorem: non-elliptic_genus_one_equations} and \cref{theorem: bielliptic_eqns}. \end{itemize} All computations described in this paper were performed in Magma \cite{Magma}. All related code, as well as computed lists, can be found in the Github repository \cite{PSRepo}. \section*{Acknowledgments} We thank Jim Stankewicz for helpful conversation and for sharing his code for computing the dual graph of the special fiber of an Atkin--Lehner quotient $X_0^D(N)/\langle w_p angle$ over $\Z_p$. This project was completed in part while F.S.\@ was a visitor at the Max-Planck-Institut f"{u}r Mathematik in Bonn, and he is much obliged to the institute for its support and to the staff and researchers at MPIM for their hospitality. \section{Background}\label{Background_section} \subsection{The Shimura curves $X_0^D(N)$}\label{Shimura_curves_background_subsection} A 	extbf{quaternion algebra} over a field $F$ is a central simple algebra over $F$ of dimension $4$. For example, we always have the split quaternion algebra $M_2(F)$ over $F$. For a quaternion algebra $B$ over $\Q$, we call $B$ 	extbf{indefinite} if it is split over the real numbers, i.e., if \[ B_\infty := B \otimes_{\Q} \R \cong M_2(\R), \] and otherwise we call $B$ 	extbf{definite}. A quaternion algebra $B$ over $\Q$ is determined up to isomorphism by its 	extbf{discriminant} $D$, which is the product of primes $p$ such that $B$ is ramified (non-split) over $\Q_p$. This discriminant $D$ is the product of an even or odd number of distinct prime numbers according to whether $B$ is indefinite or definite, respectively. Fix $D$ the discriminant of an indefinite quaternion algebra $B$ over $\Q$ and $N$ a positive integer with $\gcd(D,N) = 1$. We let $\mathcal{O}_N$ be a fixed 	extbf{Eichler order} in $B$ of level $N$. That is, $\mathcal{O}_N$ is the intersection of two (not necessarily distinct) maximal orders in $B$, and can be defined locally at each finite place of $\Q$ as follows:  egin{itemize} \item If $p \mid D$, then $B_p := B \otimes_{\Q} \Q_p$ is non-split (is a division field) and the localization $\mathcal{O}_{N,p} := \mathcal{O}_N 	imes_\Z \Z_p$ is taken to be the unique maximal order of $B_p$. \item Otherwise, if $p 
mid D$, we fix an isomorphism $\psi_\ell : B_p 	o M_2(\Q_p)$ and we take $\mathcal{O}_{N,p}$ such that \[ \psi_p\left(\mathcal{O}_{N,p})ight) = \left \{  egin{pmatrix} a & b \ Nc & d \end{pmatrix} \mid a,b,c,d \in \Z_p ight\}. \] \end{itemize} Fixing an isomorphism $\psi_\infty : B_\infty 	o M_2(\R)$, we have from this map an action of $B_\infty$ on the double half-plane $\Omega := \C \setminus \R$. We have a Riemann surface $X = \mathcal{O}_N^	imes  ackslash \Omega$ which is determined up to isomorphism by $D$ and $N$ (in particular, does not depend on our choice of Eichler order), and it is a theorem of Shimura \cite[Main Theorem 1]{Sh67} that $X$ has a canonical model defined over $\Q$ which we denote by $X_0^D(N)$. By work of Drinfeld (see \cite{BC91,Buzzard}), $X_0^D(N)$ admits a flat proper model over $\Z$ which is smooth over $\Z\left[	frac{1}{DN}ight]$. In particular, $X_0^D(N)$ has good reduction at all primes $p 
