ew} \longrightarrow \Jac(X_0^D(N)) \] such that, for each Atkin--Lehner involution $w_m(D,N) \in W_0(D,N)$, the corresponding automorphism $\Psi^*(w_m(D,N))$ on $\Jac(X_0(DN))^{D-	extnormal{new}}$ is  egin{equation}\label{eqn: AL_action_Ribet} \Psi^*(w_m(D,N)) = (-1)^{\omega(\gcd(D,m))}w_m(1,DN), \end{equation} where $w_m(1,DN) \in W_0(1,DN)$ denotes the Atkin--Lehner involution corresponding to $m$ on the modular curve $X_0(DN)$. \end{theorem} \subsection{{\v{C}}erednik--Drinfeld uniformizations}\label{dual_graphs_section} For the remainder of this section, we fix $D>1$ the discriminant of an indefinite quaternion algebra $B$ over $\Q$, $N$ a squarefree positive integer with $\gcd(D,N) = 1$, and $p$ a prime divisior of $D$. We recall the main details of the theory of the $p$-adic uniformization of $X_0^D(N)$ and its Atkin--Lehner quotients at primes $p \mid D$ due to {\v{C}}erednik--Drinfeld. The original sources for these results are \cite{Cerednik, Drinfeld}, while our main references for this material are \cite{Kurihara, Ogg83}, \cite[Chapter 3]{BC91}, and \cite[\S 1.7]{BD96}. For clarity, let us first recall the notion of a graph (with lengths) that we will use, and related constructions, as given in \cite[\S 3]{Kurihara}.  egin{definition} A 	extbf{graph} $X$ consists of the following data:  egin{itemize} \item a set $	extnormal{Ver}(X)$ of 	extbf{vertices} of $X$, \item a set $	extnormal{Ed}(X)$ of 	extbf{oriented edges} of $X$, \item functions $o, t : 	extnormal{Ed}(X) ightarrow 	extnormal{Ver}(X)$, and \item a function  egin{align*} 	extnormal{Ed}(X) &\longrightarrow 	extnormal{Ed}(X) \ y &\longmapsto \overline{y} \end{align*} such that $\overline{\overline{y}} = y$ and $o(y) = t(\overline{y})$ for all $y \in 	extnormal{Ed}(X)$. \end{itemize} For $y \in 	extnormal{Ed}(X)$, we call $o(y)$ and $t(y)$ the 	extbf{origin} and 	extbf{terminal} vertices of $y$, respectively, and we call the oriented edge $\overline{y}$ the 	extbf{inverse} of $y$. An 	extbf{(unori