mid m\}$, on $G$. For $w_m \in \widehat{W}$ this is clear -- we take $w_m$ to be given by the action of an element of norm $m$ in $\widehat{O}_N$. The involution $w_p$ is then given by the action of any element of $\Gamma_p$ which is not in $\Gamma$. In this way, we recognize the covering $G 	o G_p$ as the bipartite covering of graphs with lengths with respect to the action of $w_p$. This is to say, the $2h$ vertices of $G$ can be partitioned into two sets $V_+ = \{x_{1,+}, \ldots, x_{h,+}\}$ and $V_- = \{x_{1,-}, \ldots, x_{h,-}\}$, where each of $V_+$ and $V_-$ give a set of representatives for the $h$ vertices in $G_p$, such that $w_p(x_{i,+}) = w_p(x_{i,-})$ for each $1 \leq i \leq h$. We have the following useful observations:  egin{itemize} \item Each vertex in $V_+$ is an odd distance from each other vertex in $V_+$, and is an even distance from each vertex in $V_-$. It follows that $G$ contains no half-edges. \item If $w_m \in \widehat{W}$, then $w_m$ permutes both $V_+$ and $V_-$. \item If $p \mid m$, then $w_m$ sends each vertex in $V_+$ to a vertex in $V_-$ (and vice-versa). \end{itemize} Let $W \leq W_0(D,N)$ be an Atkin--Lehner subgroup. Then from the action defined above we get an associated graph with lengths ootnote{We urge the reader to note that the information of $D, N,$ and $p$ are fixed at the start and are not inherent in the notation $G_W$ for these graphs. The amount of decoration we will add to this notation is enough that we believe this to be best, and we will clearly fix these quantities in all examples in order to avoid confusion.} $G_W := G/W$. In particular, we have $G = G_{\{	ext{Id}\}}$ and $G_p = G_{\langle w_p angle}$. We are now prepared to state the main result of this section, as stated in \cite[p. 202]{Ogg85} and \cite[Theorem 1.3, Corollary 1.4]{BD96}.  egin{theorem}[{\v{C}}erednik--Drinfeld]\label{theorem: CD_uniformization} Let $D$ be the discriminant of an indefinite quaternion algebra over $\Q$, let $N$ be a squarefree positive integer with $\gcd(D,N) = 1$, and let $p \mid D$ be a prime. Let $W \leq W_0(D,N)$ be an Atkin--Lehner subgroup, and let $G_W$ be as defined above. Then the Atkin--Lehner quotient $X_0^D(N)/W$ over $\Z_p$ is a Mumford curve (c.f. \cite{Mumford}), and the dual graph of its special fiber is given by $\widetilde{G_W^*}$ with $w_p$ inducing the Frobenius automorphism. \end{theorem} Computations of the graphs $G_W$ are achievable using Magma \cite{Magma}, with functionality for the requisite quaternion arithmetic provided in part by the Brandt Modules package by Kohel. Code to compute the data of the graph $G_p$ and the Atkin--Lehner action on $G_p$ was developed by Stankewicz for \cite{Stankewicz} and is available at \cite{StankewiczCode}. We extend this implementation to compute the data of $G_W$ for a general $W \leq W_0(D,N)$ in the file 	exttt{dual{\_}graphs.m} in \cite{PSRepo}. \section{Reduction types and local obstructions}\label{Kodaira_section} In this section, we describe our implementation of two algorithms which use as a basis the implementation of the theory in \cref{dual_graphs_section}. The first regards reduction types of genus $1$ Atkin--Lehner quotients.  egin{algorithm}[Kodaira symbols at primes $p \mid D$]\label{algorithm: Kodaira_alg}\phantom{} \ 	extnormal{	extbf{Input:}} A tuple $(D,N,S)$ where  egin{itemize} \item $D$ is the discriminant of an indefinite quaternion algebra over $\Q$, \item $N$ is a squarefree positive integer with $\gcd(D,N) = 1$, and \item $S$ is a set of generators for a subgroup $W \leq W_0(D,N)$ such that the quotient $X_0^D(N)/W$ has genus $1$. \end{itemize} 	extnormal{	extbf{Output:}} The set of all Kodaira symbols of $\Jac(X_0^D(N)/W)$ at primes $p \mid D$. \end{algorithm} By \cref{theorem: CD_uniformization}, we know that the Kodaira symbol $\Jac(X_0^D(N)/W)$ at a prime $p \mid D$ is $I_n$ for some $n \in \Z^+$. For each fixed $p \mid D$, the steps of \cref{algorithm: Kodaira_alg} to compute the Kodaira symbol at $p$ are as follows:  egin{enumerate} \item Using the material of \cref{dual_graphs_section}, we compute the edge set $E_W$ of $G_W$, along with the action of Atkin--Lehner operators on these edges and the stabilizer orders of each edge. If $e$ is an edge in the edge set $E$ of $G$ and \[ [e] = \{w(e) \mid w \in W\} \] is its image in $E_W$, represented as a $W$-orbit of edges from $E$, then the size of the stabilizer of $[e]$ is \[ \#	extnormal{Stab}([e]) = \#	extnormal{Stab}(e) \cdot \dfrac{\#W}{\#[e]}. \] \item We remove half-edges from $E_W$, and we then remove from $E_W$ any edge which is the unique edge incident to either its origin or terminal vertex in order to obtain $G_W^	ext{min}$. We repeat the latter step until no such edges remain, such that our graph is confirmed to be minimal. Let $\widetilde{E_W}$ denote the resulting edge set. \item Following step (2), we need only resolve edges in $\widetilde{E_W}$ to get the dual graph of the minimal regular model of $\Jac(X_0^D(N)/W)$ over $\Z_p$. Otherwise put, our Kodaira symbol at $p$ for this Jacobian is $I_n$, where \[ n := \sum_{[e] \in \widetilde{E_W}} \#	extnormal{Stab}([e]). \] \end{enumerate}  egin{remark}\label{Kodaira_alg_gne1_remark} If the genus of $X = X_0^D(N)/W$ is greater than $1$, then the steps outlined above still serve to yield the reduction type of $X$ at any prime $p \mid D$. Of course, the possible reduction types for higher genus are more varied, so we leave the statement of \cref{algorithm: Kodaira_alg} as it is for simplicity. We will mainly use the above procedure in the genus $1$ case, but in \cref{genus_2_bielliptics_section} we will briefly consider reduction types in the genus $2$ case. \end{remark} Our second algorithm regards the existence of local points at primes dividing $D$. Jordan--Livn'e \cite[Theorems 5.1, 5.4, 5.6]{JordanLivne} proved results on the existence of $\Q_p$ points on $X_0^D(1)$ for $p \mid D$ , while Ogg \cite[Th'eor\`eme]{Ogg85} extended these results to Atkin--Lehner quotients $X_0^D(N)/W$ with $\#W \leq 2$. Stankewicz \cite{Stankewicz} also proved quite general results on local points on twists of the Shimura curves $X_0^D(N)$. In the works of Ogg and of Jordan--Livne, the authors crucially use Hensel's lemma applied to the situation at hand (see \cite[Lemma 1.1]{JordanLivne}: for a Mumford curve $X$ over $\Z_p$, this states that $X$ has a point over $\Q_p$ if and only if the resolution of the special fiber of $X$ has a smooth point over $\F_p$. We translate this equivalence in our situation using \cref{theorem: CD_uniformization}: fixing a prime $p \mid D$, the quotient $X_0^D(N)/W$ has a point over $\Q_p$ if and only if $\widetilde{G_W^	ext{min}}$ has a vertex $x$ so that  egin{itemize} \item $w_p(x) = x$ (such that $x$ corresponds to a component of the special fiber defined over $\F_p$), and so that \item there are strictly less than $p+1$ oriented edges $y$ with $o(y) = x$ and with $w_p(y) = \overline{y}$ (such that the component corresponding to $x$ contains a smooth point). \end{itemize} Using this criterion for local points with our previously described computations of the graphs $\widetilde{G_W}^	ext{min}$, we have an algorithmic version of the results of Jordan--Livne and Ogg generalized to arbitrary Atkin--Lehner quotients of $X_0^D(N)/W$ with $N$ squarefree.  egin{algorithm}[Local points at primes $p \mid D$]\label{algorithm: local_points}\phantom{} \ 	extnormal{	extbf{Input:}} A tuple $(D,N,S,p)$ where  egin{itemize} \item $D$ is the discriminant of an indefinite quaternion algebra over $\Q$, \item $N$ is a squarefree positive integer with $\gcd(D,N) = 1$, \item $S$ is a set of generators for a subgroup $W \leq W_0(D,N)$, and \item $p \mid D$ is a prime. \end{itemize} 	extnormal{	extbf{Output:}} A boolean 	exttt{true} if $\left(X_0^D(N)/Wight)(\Q_p) 
eq \emptyset$ and 	exttt{false} otherwise. \end{algorithm} \section{Atkin--Lehner quotients of genus at most $2$}\label{genus_le_2_section} \subsection{Proof of \cref{theorem: genus_le_2}}\label{determining_genus_le2_subsection} We determine here all Atkin--Lehner quotients $X_0^D(N)/W$, with $\gcd(D,N) = 1$ and $D>1$, having genus at most $1$. To begin, we recall two results that will allow us restrict attention to a finite list of pairs $(D,N)$. First is a lower bound on the geometric gonality $\gamma_{\C}(X_0^D(N))$ of $X_0^D(N)$, which is a special case of a more general theorem of Abramovich (where we have improved the constant appearing using the best known result on Selberg's eigenvalue conjecture \cite[p. 176]{K03}).  egin{theorem}{\cite[Theorem 1.1]{Abramovich96}} \label{theorem: Abr} For the Shimura curve $X_0^D(N)$, we have \[ \gamma_{\C}(X_0^D(N)) \ge  rac{975}{8192} ig(g(X_0^D(N))-1 ig). \] \end{theorem} Next, we have an explicit bound on the genus of $X_0^D(N)$ in terms of the product $DN$.  egin{lemma}\cite[Lemma 10.6]{Saia24}\label{Lemma: Saia_genus_bound} Let $\gamma$ denote the Euler--Mascheroni constant. For $D>1$ an indefinite rational quaternion discriminant and $N$ a positive integer coprime to $D$, we have \[ g(X_0^D(N)) > 1 +  rac{DN}{12}\left(  rac{1}{e^\gamma \log\log(DN) +  rac{3}{\log\log{6}}} ight)-  rac{7\sqrt{DN}}{3}. \] \end{lemma} Let \[ X_0^D(N)^* := X_0^D(N)/W_0(D,N) \] denote the quotient of $X_0^D(N)$ by the full Atkin--Lehner group. Let $d(m)$ denote the number of divisors of a positive integer $m$. The natural map \[ X_0^D(N) ightarrow X_0^D(N)^* \] over $\Q$ has degree $2^{\omega(DN)}$, and thus we have, for every algebraic extension $F/\Q$,  egin{align*} \gamma_F(X_0^D(N)) &\leq 2^{\omega(DN)}\gamma_F(X_0^D(N)^*) \ &\leq d(DN) \gamma_F(X_0^D(N)^*) \ &\leq 2 \sqrt{DN} \gamma_F(X_0^D(N)^*). \end{align*} \cref{theorem: Abr} then provides  egin{equation}\label{genus_star_gon_eqn}  rac{975}{16384\sqrt{DN}}\left(g(X_0^D(N))-1ight) \leq \gamma_{\C}(X_0^D(N)^*) \leq \gamma_F(X_0^D(N)^*), \end{equation} from which \cref{Lemma: Saia_genus_bound} yields  egin{equation}\label{DN_star_gon_eqn}  rac{975}{16384} \left(  rac{\sqrt{DN}}{12}\left(  rac{1}{e^\gamma \log\log(DN) +  rac{3}{\log\log{6}}} ight)-  rac{7}{3} ight) \leq \gamma_F(X_0^D(N)^*). \end{equation} Suppose that we have some $W \leq W_0(D,N)$ such that $g\left(X_0^D(N)/Wight) \leq 1$. We then have $g(X_0^D(N)^*) \leq 1$ and $\gamma_{\overline{\Q}}(X_0^D(N)^*) \leq 2$, and so \cref{DN_star_gon_eqn} implies $DN \leq 19226700$. Computing the genus of $X_0^D(N)^*$ for all pairs $(D,N)$ with $DN \leq 19226700$, we determine that among the curves $X_0^D(N)^*$ there are exactly $271$ of genus $0$, exactly $276$ curves of genus $1$, and exactly $289$ of genus $2$. Next, we consider general quotients. If $X_0^D(N)^*$ has genus at most $1$, i.e., if $(D,N)$ is among the $836$ pairs we have just computed, then $\omega(DN) \leq 5$. With a bit of care in our enumeration of Atkin--Lehner subgroups, we compute the genus of $X_0^D(N)/W$ for every triple $(D,N,W)$ with $X_0^D(N)^*$ having genus at most $1$ and with $W \leq W_0(D,N)$ in less than an hour of computational time. \cref{theorem: genus_le_2} follows from the direct computations described above, with corresponding code found in the file 	exttt{genus{\_}le2{\_}quotient{\_}checks.m}. \subsection{Rational points}\label{rational_points_subsection} For each Atkin--Lehner quotient $X = X_0^D(N)/W$ of genus $0$ (respectively, of genus $1$), we would next like to determine whether $X$ a rational point and hence is isomorphic to the projective line $\mathbb{P}^1_{\Q}$ (respectively, is an elliptic curve over $\Q$) rather than being a pointless conic (respectively, a non-elliptic genus $1$ curve) over $\Q$. To show that $X$ does have a rational point, our first strategy (when $N$ is squarefree) is to show that it has a rational CM point. We does this by enumerating the set $S$ of quadratic CM points