eq \emptyset$ if and only if $X$ has points over $\R$ and over $\Q_p$ for every $p$. If $D$ is even, $N = 1$, and $X$ passed the local obstruction checks described above, then we know it has points over $\Q_p$ for all primes $p$; for $p 
mid D$, the reduction of $X$ over $\F_p$ is a smooth conic, hence isomorphic to $\P^1_{\F_p}$, and then Hensel's lemma implies $X(\Q_p) 
