eq \emptyset$. If all of the above fails, then we resort to prior results. For the full quotients $X_0^D(N)^*$ of genus $0$, \cite[Proposition 4.2]{NR15} states that $X_0^D(N)^*$ has a rational CM point. We can also use explicit equations in cases where $X_0^D(N)$ is hyperelliptic or of genus $0$ or $1$, coming from the works \cite{GR06, GY17, PS23}. Beyond the above strategies, we have one more technique for proving that genus $1$ curves have rational points. This requires the material of \cref{non_elliptic_eqns_section}, and so we save discussion of this strategy for \cref{non_elliptic_rat_pts_section}. Of course, Hasse Principle violations can occur when $X$ has genus $1$. The techniques we use provide no means to detect this unless we already have an explicit equation coming from prior work.  egin{remark} We list in the final section of this work all genus $0$ quotients which we prove have rational points (\cref{table: genus_0_rat_pts}), all genus $0$ quotients for which we remain unsure of the existence of rational points (\cref{table: genus_0_unknown_rat_pts}), and genus $1$ quotients with positive rank Jacobian for which we either prove the existence of a rational point (\cref{table: genus_1_rat_pts_pos_rank} or remain unsure of the existence of a rational point (\cref{table: genus_1_unknown_rat_pts_pos_rank}). For brevity, we do not list \emph{all} quotients of genus at most $2$, and for example do not list those curves of genus $0$ for which we prove there are no rational points. Complete lists, however, can be found in \cite{PSRepo}. \end{remark}  egin{remark} In performing rational points checks, we noted that is a typo in \cite[Theorem 3.4]{GR06} for the equation of the involution $w_{10}$ on the curve $X_0^{10}(7)$. The given equation does not define an automorphism on the provided model, and the correct equation is \[ w_{10}(x,y) = \left( rac{2x+1}{x-2}, rac{5y}{(x-2)^2}ight). \] The first given involution for this curve is also mistakenly called $w_{