se square divides $N$ in the conductor. This occurs for $348$ genus $1$ quotients $X_0^D(N)/W$. Via direct computation of Kodaira symbols at all primes $p \mid D$ for all genus $1$ quotients $X_0^D(N)/W$ with $N$ squarefree using \cref{algorithm: Kodaira_alg}, we observe that no such quotient has Jacobian with good reduction at a prime $p \mid D$. Therefore, if there \emph{is} a loss of prime of bad reduction, or more generally if the isomorphism class of $J$ has conductor properly dividing $DN$, then the change has to be restricted to divisors of $N$. In particular, if $N$ is prime and we observe that there is a loss of prime of bad reduction in taking the quotient by $W$ (by search in the new space of modular symbols of level $DN$ as described above), then we know the correct modular symbol must be new in level $D$. This observation helps considerably in reducing computing time in situations where this phenomena occurs, as the following example illustrates. This example also serves to show our method to determine the correct one-dimensional space of symbols in this new space of level $D$ in this situation.  egin{example}\label{loss_of_N_example} Consider the genus $1$ curve $X = X_0^{210}(11)/\langle w_2, w_5, w_7, w_{33} angle$. The curve $X_0(210\cdot 11) = X_0(561)$ has genus $561$, and so it comes as no surprise that the computation of the decomposition of the abelian subvariety of its Jacobian cut out by the action of $W$ via Ribet's isogeny is intensive; the computation did not complete within three days on our machine. We observe by direct computation that there are no components compatible with the sign pattern given by the action of $W$ in the new space of the cuspidal subspace of modular symbols of level $561$, weight $2$, and sign $-1$. We also observe from direct computation using \cref{algorithm: Kodaira_alg} that $J = \Jac(X)$ does not have good reduction at any primes dividing $210$; the symbols at $2, 3, 5,$ and $7$, respectively are $I_4, I_2, I_2$, and $I_4$. Hence, as $11$ is prime, we \emph{must} find that the correct modular symbol and modular form is new in level $210$. In searching for a symbol that is compatible with the action of $W$ on this new space of level $D$, one must be careful as the sign pattern imposed by this action at each prime is not necessarily the same as it was in level $DN$. We avoid this difficulty as follows: we simply enumerate \emph{all} one-dimensional components in this space, and correspondingly take all curves in isogeny classes over $\Q$ of conductor $D$, and we then check Kodaira symbols against those computed for $J$. In our example, there are $5$ such one-dimensional spaces of symbols which are new in level $210$ and this $37$ isomorphism classes of elliptic curves with conductor $210$ to check -- those in isogeny classes with Cremona labels $210$a, $210$b, $210$c, $210$d, and $210$e. The only curve among these classes with the symbols $I_4, I_2, I_2,$ and $I_4$ at $2, 3, 5,$ and $7$, respectively, is that of Cremona reference $210$c$2$, with equation \[ y^2 + xy + y = x^3 + x^2 - 70x - 205, \] and so $J$ is isomorphic (not just isogenous, as we aim to show in this section) over $\Q$ to this curve. \end{example} Pleasingly, we find that in all examples where the conductor of $J$ is not $DN$ and where the brute force method using an explicit Jacobian decomposition does not succeed in a reasonable time, we indeed have that $N$ is prime and that we are able to uniquely determine the isomorphism class using Kodaira symbol comparisons as in \cref{loss_of_N_example}. The described computations thus provide the following proposition.  egin{proposition}\label{prop: genus_one_jacobian_isogeny_classes} There are exactly $1270$ curves $X = X_0^D(N)/W$ of genus $1$ with $W \leq W_0(D,N)$ non-trivial and with $N$ squarefree. Each of these curves is listed in \cref{table: genus_1_sqfree_iso_classes}, and in each case $\Jac(X)$ is in the same isogeny class over $\Q$ as the curve with 