le $-420$-CM point on $X_0^{21}(5)$. Letting $K = \Q(\sqrt{-105})$, the residue field of this point over $\Q$ is a totally complex index $2$ subfield of the ring class field $H$ corresponding to the maximal order in $K$, and its image on $X_0^{21}(5)/\langle w_3 angle$ has degree $4$. The splitting field of the defining polynomial in $x$ for $C_1$ is not contained in this residue field (it is not even contained in $H$), hence $X$ is isomorphic over $\Q$ to $C_3$. \end{example} \subsection{A return to rational points}\label{non_elliptic_rat_pts_section} We now briefly return to the investigation of the existence of rational points on genus $1$ quotients started in \cref{rational_points_subsection}. We propose a final strategy, using the material of the prior section, to prove a genus $1$ Atkin--Lehner quotient is an elliptic curve with no explicit knowledge of its rational points. Let $X = X_0^D(N)/W$ be a genus $1$ Atkin--Lehner quotient, let $w \in \Aut(X)$ be an Atkin--Lehner involution, and let $x \in X_0^D(N)$ be a CM point whose image on $X/\langle w angle$ is rational. Supposing that $X$ itself has no rational points, we can apply \cref{proposition: GR06_twist_equations} to compute a set $\mathcal{C}_X$ of candidate models for $X$. We can then discard candidates using the same methods used in the proof of \cref{theorem: non-elliptic_genus_one_equations}, by testing the existence of points over $\Q_p$ for $p \mid D$, the existence of real points, and the agreement of our model with the residue fields of fixed points of $w$. If these methods leave $\mathcal{C}_W$ empty, then we have proved by way of contradiction that $X$ must have a rational point and be an elliptic curve over $\Q$. This method succeeds for $28$ genus $1$ curves for which we remained unsure of the existence of rational points on $X$ following the methods of \cref{rational_points_subsection}, and these curves are listed in the file \[ 	exttt{genus{\_}1{\_}AL{\_}quotients{\_}rat{\_}pts{\_}by{\_}non{\_}elliptic{\_}test{\_}final.m} \] in \cite{PSRepo}. In attempting the above method, we reduce to exactly one candidate non-elliptic equation, which we are not able to eliminate by our techniques, for $25$ curves. This leads to the following proposition.  egin{proposition} For each of the $25$ genus $1$ curve $X = X_0^D(N)/W$ with $(D,N,W)$ listed in \cref{table: unknown_possible_non_elliptic_eqns}, we have that either $X$ has a rational point (and is thus isomorphic to its Jacobian, whose isomorphism class is give in \cref{table: genus_1_sqfree_iso_classes}), or $X(\Q) = \emptyset$ and $X$ admits the model $y^2 = f(x)$ over $\Q$ for the given polynomial $f$. \end{proposition}  egin{proof} For each triple $(D,N,W)$ appearing in this table, we are able to find a CM point on $X_0^D(N)$ with the necessary setup to apply \cref{proposition: GR06_twist_equations}. We then generate a list of candidate equations, one of which must be an equation for $X_0^D(N)/W$ if this curve lacks a rational point. Using the techniques described in the proof of \cref{theorem: non-elliptic_genus_one_equations}, we are able to exclude all but one candidate model, and hence $X_0^D(N)/W$ is either an elliptic curve or admits this model. \end{proof} { egin{center} owcolors{2}{white}{gray!20}  egin{longtable}{|c|c|c|c|} \caption{Possible non-elliptic models of the form $y^2=f(x)$ for $25$ genus $1$ curves $X = X_0^D(N)/W$ for which we remain unsure of whether $X$ has a rational point. For each $X$, the hyperelliptic involution with respect to the given model (if correct) is the image of the Fricke involution $w_{DN}$ on $X$.}\label{table: unknown_possible_non_elliptic_eqns} \ \hline owcolor{gray!50} $D$ & $N$ & $W$ & $f$ \ \hline $ 6 $ & $ 35 $ & $ \langle w_{ 10 } , w_{ 42 } angle $ & $ -19x^4 - 1003770x^2 - 3480192x - 13271278707 $ \ \hline $ 6 $ & $ 85 $ & $ \langle w_{ 2 } , w_{ 15 } , w_{ 51 } angle $ & $ -4x^4 + 1733355/8x^2 - 434388339/16x + 974320350867/1024 $ \ \hline $ 6 $ & $