.  egin{example} Consider the genus $2$ curve $X = X_0^6(133)/\langle w_7, w_{19}, w_{57} angle$. The only non-trivial Atkin--Lehner quotient $X_0^6(133)^*$ has genus $1$. Therefore, the hyperelliptic involution $\iota$ and the bielliptic involution $\iota \circ w_2$ are both non-Atkin--Lehner. \end{example} We compute directly that there are exactly $388$ bielliptic genus $2$ curves $X_0^D(N)/W$ with two bielliptic Atkin--Lehner quotients, and there are exactly $251$ such curves with exactly one bielliptic Atkin--Lehner involution. We seek to generalize the results of Gonzlez--Rotger \cite{GR04} to arbitrary level and quotients by computing equations for all of these curves. This includes recovering equations for the $10$ curves $X_0^D(1)/\langle w_m angle$ handled in \cite{GR04}. We use the following proposition from their work, which allows us to compute a finite set of candidate equations for a given bielliptic genus $2$ quotient $X$, to this aim.  egin{proposition}\cite[Proposition 2.1]{GR04}\label{GR_bielliptic_eqn_prop} Let $C$ be a genus two curve defined over a field $k$ of characteristic not $2$ or $3$, and let $\iota$ be its hyperelliptic involution. Assume that $\Aut_k(C)$ contains a subgroup $\langle u_1, u_2 angle \cong (\Z/2\Z)^2$ with $u_2 = \iota \circ u_1$ and denote by $C_i$ the elliptic quotient $C/\langle u_i angle$ for $i \in \{1,2\}$. If the two elliptic curves  egin{align*} E_1 : Y^2 &= X^3 + A_1X + B_1 \ E_2 : Y^2 &= X^3 + A_2X + B_2 \end{align*} are isomorphic over $k$ to $C_1$ and $C_2$, respectively, then there exists a solution $(a,b) \in k^	imes 	imes k$ to the system of equations  egin{align*} 27a^3 B_2 &= 2A_1^3 + 27B_1^2 + 9A_1B_1b + 2A_1^2b^2 - B_1b^3 \ 9a^2 A_2 &= -3A_1^2 + 9B_1b + A_1b^2. \end{align*} such that, letting  egin{align*} c &:=  rac{3A_1+b^2}{3a} \quad \quad 	ext{ and } \ d &:=  rac{27B_1 + 9A_1b + b^3}{27a^2} \; , \end{align*} we have that $C$ admits the hyperelliptic equation $y^2 = ax^6 + bx^4 + cx^2 + d$ with $u_1$ given by $(x,y) \mapsto (-x,y)$. \end{proposition} We now use \cref{GR_bielliptic_eqn_prop} to prove our main result. A notable distinction in the proof of our result, compared to that of \cite{GR04}, is that for the $10$ quotients they study the referenced proposition provides a single, necessarily correct, candidate model. In our case, we generally arrive at multiple candidate equations and we need to use arithmetic information to try to determine the correct model.  egin{theorem}\label{theorem: bielliptic_eqns}  egin{enumerate} \item There are exactly $639$ genus $2$ curves $X = X_0^D(N)/W$, with $W \leq W_0(D,N)$ nontrivial, so that $X$ has a bielliptic Atkin--Lehner involution. \item For the $405$ curves $X = X_0^D(N)/W$ listed in \cref{table: genus_2_bielliptic_eqns}, we have that $X$ is bielliptic of genus $2$ and admits the given equation over $\mathbb{Q}$. \item If $X = X_0^D(N)/W$, with $W \leq W_0(D,N)$ nontrivial, is bielliptic of genus $2$ and does not have a bielliptic Atkin--Lehner involution, then $X$ must be among the $76$ curves listed in \cref{table: bielliptic_non_AL_candidates}. \end{enumerate} \end{theorem}  egin{proof} We already described above the enumeration of all bielliptic genus $2$ Atkin--Lehner quotients with at least one bielliptic Atkin--Lehner involution, giving part (1), and so we proceed with part (2). Let $X = X_0^D(N)/W$ be such a quotient, and let $E_1$ be a bielliptic Atkin--Lehner quotient of $X$. If the other bielliptic involution on $X$ is Atkin--Lehner, then let $E_2$ be the other bielliptic quotient. Otherwise, let $E_2$ be any member of the isogeny class of the isogeny factor in $\Jac(X)$ not corresponding to $E_1,$ which we compute using \cref{Ribet_isog}. For $i \in \{1,2\}$, let $\mathcal{I}_i$ be the singleton set containing the isomorphism class of $E_i$ if $E_i$ is a bielliptic Atkin--Lehner quotient of $X$ and this isomorphism class was computed in \cref{genus_1_iso_classes_section}. Otherwise, let $\mathcal{I}_i$ denote the set of all members of the isogeny class of $E_i$ over $\Q$ (as computed in \cref{genus_1_isogeny_class_section} if $E_i$ is a bielliptic Atkin--Lehner quotient of $X$). For each pair $(E_1',E_2') \in \mathcal{I}_1 	imes \mathcal{I}_2$, we attempt to compute all candidate equations for a bielliptic cover of $E_1'$ and $E_2'$ using \cref{GR_bielliptic_eqn_prop}. This works in all cases except for the three genus $2$ curves  egin{align*} X_0^{390}(11)&/\langle w_2, w_5, w_{13}, w_{33} angle \; , \qquad X_0^{714}(5)/ \langle w_2, w_5, w_{17}, w_{21} angle, \ &	ext{ and } \qquad X_0^{798}(5)/\langle w_2, w_3, w_{19}, w_{35} angle \; . \end{align*} For each of these $3$ curves, there is one non-Atkin--Lehner bielliptic quotient, and the Jacobian isogeny factor corresponding to this quotient has conductor properly dividing $DN$. We lack knowledge of the correct conductor, and the naive method using Ribet's isogeny with a decomposition of the Jacobian of the $D$-new part of $X_0(DN)$ seems infeasible to compute in a reasonable time due to the genus of $X_0(N)$ being rather large -- more specifically, the genera are $993, 849,$ and $945$. Aside from the above three curves, we succeed in computing candidate equations in each case and we let $\mathcal{H}_X$ denote the set of all such candidate equations over all pairs in $\mathcal{I}_1 	imes \mathcal{I}_2$ up to isomorphism over $\Q$ of the hyperelliptic curve they define. Then, by design, $\mathcal{H}_X$ contains exactly one model for $X$. If $\#\mathcal{H}_X = 1$, then we have determined the equation for $X$. Otherwise, we attempt to exclude elements of $\mathcal{H}_X$ as possible candidate equations using two strategies. If we know that $X$ has real points using Ogg's criterion then we can exclude any models which lack real points. Our main tool, though, is as follows: we compute the number of edges in the dual graph of the minimal regular model of $X$ over $\Z_p$ at all odd primes $p \mid D$ using the same method of \cref{algorithm: Kodaira_alg}, ootnote{Of course, this is coarser information than the reduction types themselves. In our case, we check that it is enough to distinguish between any candidates for which there is at least one odd prime $p \mid D$ at which their reduction types differ except for the curve $X_0^{14}(17)/\langle w_7, w_{34} angle$. In this case, it helps us exclude one candidate equation, but we are still left with two with the same reduction types at $p=7$ and $p=17$. Note that we ignore reductions at $2$ when $2 \mid DN$ only because computations at $2$ are not implemented in the referenced package; we are able to compute dual graphs at $2$ for Atkin--Lehner quotients.} and we compare these counts to those of each hyperelliptic curve $H$ with a model in $\mathcal{H}_X$. This is done in Magma using Tim Dokchitser's package 	exttt{redlib} \cite{redlib}, which is based on the works \cite{Dokchitser_models, Muselli} as well as \cite{NU73} in the genus $2$ case. If there is at least one prime $p \mid D$ at which there is a discrepancy, then we discard the model for $H$ from $\mathcal{H}_X$. The code for these computations are contained in the files 	exttt{genus{\_}2{\_}bielliptic{\_}eqns.m} and 	exttt{narrowing{\_}bielliptic{\_}eqns.m} in \cite{PSRepo}. Once more, if we are left with a single candidate equation in $\mathcal{H}_X$ then that is the equation for $X$ and we list the curve in \cref{table: genus_2_bielliptic_eqns} as stated in part (2). For the genus $2$ curves which are not bielliptic via an Atkin--Lehner involution, we prove that they are not bielliptic in one of two ways:  egin{enumerate} \item by knowledge that all automorphisms are Atkin--Lehner, coming from work of Kontogeorgis--Rotger \cite{KR08} and from \cite[Theorem 1.3]{MPSS25}, or \item by computing that $\Jac(X)$ is simple over $\Q$. \end{enumerate} The relevant code for these computations is included in the file \[ 	ext{	exttt{computing{\_}genus{\_}2{\_}bielliptics.m